import React from "react";
import "../../../Styles/Pages/About/AboutSecond.scss";

function AboutSecond() {
  return (
    <div className='aboutSecond'>
      <h1>Lining our Values</h1>
      <p>
        Pay2Gate is the leading all-in-one monetization platform that allows
        business to quickly expand internationally and optimize recurring
        revenue streams across channels, by simplifying the back-end
        complexities of digital commerce.
      </p>
    </div>
  );
}

export default AboutSecond;
